Here is the solution without breaking the table to child tables by regions:

{% set us_flag = false %}
{% set eu_flag = false %}
{% set asia_flag = false %}

{% set location = hubdb_table_rows(1111111, queryparam) %}
         {% for row in location %}
            {#% if row.event_location.name == "United States"%}{{ row.event_location.name|unique}}&lt;br&gt; {% else%}{% endif %#}
      {% if row.event_location.name == "United States" &amp;&amp; us_flag == false %}&lt;button type="button" class="control control-color font-link text-teal" data-filter=".united-states"&gt;{{ module.labels.united_states }}&lt;/button&gt;&lt;span&gt;❘ &lt;/span&gt;{% set us_flag = true %}
      {% elif row.event_location.name == "Europe" &amp;&amp; eu_flag == false %}&lt;button type="button" class="control control-color font-link text-teal" data-filter=".europe"&gt;{{ module.labels.europe }}&lt;/button&gt;&lt;span&gt;❘ &lt;/span&gt; {% set eu_flag = true %}
      {% elif row.event_location.name == "Asia" &amp;&amp; asia_flag == false %}&lt;button type="button" class="control control-color font-link text-teal" data-filter=".asia"&gt;{{ <http://module.labels.asia|module.labels.asia> }}&lt;/button&gt;&lt;span&gt;❘ &lt;/span&gt; {% set asia_flag = true %}
      {% else %}
      {% endif %}
{% endfor %}
